(61, 1, '2022-07-24 02:22:13', '2022-07-24 05:22:13', '<style>/*! elementor - v3.6.7 - 03-07-2022 */\n.elementor-heading-title{padding:0;margin:0;line-height:1}.elementor-widget-heading .elementor-heading-title[class*=elementor-size-]>a{color:inherit;font-size:inherit;line-height:inherit}.elementor-widget-heading .elementor-heading-title.elementor-size-small{font-size:15px}.elementor-widget-heading .elementor-heading-title.elementor-size-medium{font-size:19px}.elementor-widget-heading .elementor-heading-title.elementor-size-large{font-size:29px}.elementor-widget-heading .elementor-heading-title.elementor-size-xl{font-size:39px}.elementor-widget-heading .elementor-heading-title.elementor-size-xxl{font-size:59px}</style><h2>Quienes Somos</h2>		\n			<style>/*! elementor - v3.6.7 - 03-07-2022 */\n.elementor-widget-image-carousel .swiper-container{position:static}.elementor-widget-image-carousel .swiper-container .swiper-slide figure{line-height:inherit}.elementor-widget-image-carousel .swiper-slide{text-align:center}.elementor-image-carousel-wrapper:not(.swiper-container-initialized) .swiper-slide{max-width:calc(100% / var(--e-image-carousel-slides-to-show, 3))}</style>		\n								<figure><img src=\"http://localhost/repuestos/wp-content/uploads/elementor/thumbs/robert-laursoo-my6Q5k_WmoI-unsplash-scaled-ps7yp8r0woq9onr5yrgjmc9rzgpzijbrmhj1mx0s0w.jpg\" alt=\"robert-laursoo-my6Q5k_WmoI-unsplash\" /></figure>			\n			<h1>Quienes  Somos</h1>		\n		<p>Somos el marketplace especializado en repuestos y accesorios multimarca para tu automóvil. Creado por Andes Motor del Grupo Kaufmann.Nuestro objetivo es construir la mejor plataforma digital para que puedas comprar y vender repuestos con confianza, rapidez y seguridad, acompañado en todo momento por nuestros especialistas.Para nuestros vendedores, somos el mejor partner, los acompañamos en todo el proceso de venta, entregando una plataforma robusta y flexible, enriqueciendo la información de sus productos y gestionando toda la logística necesaria para que los productos lleguen a las manos de nuestros clientes.Para nuestros clientes, tenemos un catálogo de productos seleccionados en constante crecimiento, con información detallada y apoyo continuo de nuestros especialistas en la búsqueda y selección, para que la experiencia de compra sea siempre la mejor. Si no lo tenemos, lo buscamos. Nos caracteriza el trabajo que hacemos para que sepas si es compatible con tu auto y evitar errores y devoluciones.</p>		\n			<h2>Marcas   que vendemos</h2>		\n								<figure><img src=\"http://localhost/repuestos/wp-content/uploads/elementor/thumbs/tyler-nix-691377-unsplash-ps7xk9y2ycmxs33krox7rcvp7ts4n3pl6t10sx9gvs.jpg\" alt=\"tyler-nix-691377-unsplash.jpg\" /></figure><figure><img src=\"http://localhost/repuestos/wp-content/uploads/elementor/thumbs/joseph-greve-343334-unsplash-ps9ozfx7j64alyo8olpy97im58chfvpz3ffpwvzn3s.jpg\" alt=\"joseph-greve-343334-unsplash.jpg\" /></figure><figure><img src=\"http://localhost/repuestos/wp-content/uploads/elementor/thumbs/paul-larkin-501616-unsplash-ps9oyy29xbfuhde6kw01fu0uuwsidmr2oz1hsmq4e0.jpg\" alt=\"paul-larkin-501616-unsplash.jpg\" /></figure><figure><img src=\"http://localhost/repuestos/wp-content/uploads/elementor/thumbs/nicole-honeywill-727770-unsplash-ps7xnhk8az17g4fn0kwbs1pea7y9xvgkmp9qtyi1mg.jpg\" alt=\"nicole-honeywill-727770-unsplash.jpg\" /></figure><figure><img src=\"http://localhost/repuestos/wp-content/uploads/elementor/thumbs/chris-osmond-385532-unsplash-ps7xkbtrc0pifb0ugpqgwcemeliv2hx1v2bzrh6ojc.jpg\" alt=\"chris-osmond-385532-unsplash.jpg\" /></figure><figure><img src=\"http://localhost/repuestos/wp-content/uploads/elementor/thumbs/carlos-augusto-588715-unsplash-ps7xn6a60ylrksw0ug0sy4jv5lhvdi7sl5fx2myrp4.jpg\" alt=\"carlos-augusto-588715-unsplash.jpg\" /></figure><figure><img src=\"http://localhost/repuestos/wp-content/uploads/elementor/thumbs/roman-raizen-674547-unsplash-ps7xkcrliuqsqwzhb853gu62zze8a70s76zh8r5ad4.jpg\" alt=\"roman-raizen-674547-unsplas