(194, 1, '2022-07-25 17:54:35', '2022-07-25 20:54:35', '<label> Nombre\r\n    [text* your-name] </label>\r\n\r\n<label> Email\r\n    [email* your-email] </label>\r\n\r\n<label> Asunto\r\n    [text* your-subject] </label>\r\n\r\n\r\n\r\n<label> Mensaje\r\n    [textarea your-message] </label>\r\n\r\n[file file-136 limit:10mb filetypes:doc|pdf|jpg|jpeg|png|docx|mp4]\r\n\r\n[submit \"Enviar\"]\n1\nVilla cor \"[your-subject]\"\nVillacor <rodrigo.aravena.c2002@gmail.com>\nrodrigo.aravena.c2002@gmail.com\nDe: [your-name] <[your-email]>\r\nAsunto: [your-subject]\r\n\r\nCuerpo del Mensaje\r\n[your-message]\r\n\r\n-- \r\nEste correo fue enviado utilizando Contact Form 7 en [_site_title] ([_site_url])\nReply-To: [your-email]\n\n1\n1\n\n[_site_title] \"[your-subject]\"\n[_site_title] <rodrigo.aravena.c2002@gmail.com>\n[your-email]\nCuerpo del Mensaje\r\n[your-message]\r\n\r\n-- \r\nEste correo fue enviado utilizando Contact Form 7 en [_site_title] ([_site_url])\nReply-To: [_site_admin_email]\n\n\n\nGracias por tu mensaje. Ya lo enviamos.\nHubo un error al intentar enviar tu mensaje. Por favor inténtalo más tarde.\nUno o más campos tienen un error. Por favor revísalo y reinténtalo.\nHubo un error al intentar enviar tu mensaje. Por favor inténtalo más tarde.\nDebes aceptar los términos y condiciones antes de enviar tu mensaje.\nEl campo es obligatorio.\nEl campo es demasiado largo.\nEl campo es demasiado corto.\nSucedió un error desconocido subiendo el archivo.\nNo tienes permisos para subir archivos de este tipo.\nEl archivo es demasiado grande.\nSucedió un error al subir el archivo.\nPlease enter a date in YYYY-MM-DD format.\nThis field has a too early date.\nThis field has a too late date.\nEl formato de número no es válido\nEl número es menor al mínimo permitido\nEl número es mayor al máximo permitido\nLa respuesta a la pregunta es incorrecta.\nLa dirección de correo electrónico que has introducido no es válida\nLa URL no es valida\nEl número de teléfono no es valido', 'Formulario de contacto 1', '', 'publish', 'closed', 'closed', '', 'formulario-de-contacto-1', '', '', '2022-07-25 20:34:52', '2022-07-25 23:34:52', '', 0, 'http://localhost/repuestos/?post_type=wpcf7_contact_form&#038;p=194', 0, 'wpcf7_contact_form', '', 0),
